import styled from "styled-components";

const ItemsContainer = styled.div`
  .flex;
  .flex-wrap;
  .p-4;
  .lg:p-8;
  .justify-center;
  .pb-16;
`;

const Item = styled.div`
  .bg-pwhite;
  .w-full;
  .lg: w-3/12;
  box-sizing: border-box;
  .p-4;
  .shadow;
  .mx-2;
  .my-4;
`;

const Image = styled.img`
  height: 100px;
  max-height: 100px;
  width: 100%;
  object-fit: cover;
`;


const EntityComponent = () => {
  return <></>;
};

export default EntityComponent;
